function useVoltageColor(powerMetaDefsElem, grdClr1, grdClr2, grdClr3, grdClr4, vltAlpha1, vltAlpha2, vltAlpha3, vltAlpha4)
{
     if (grdClr1 == "" && grdClr2 == "" && grdClr3 == "" && grdClr4 == "")
         return;

     var basicItemLst = powerMetaDefsElem.getElementsByTagName("g");

     var idx = 0;
     var nLen = basicItemLst.length;
     for (idx=0; idx < nLen; idx++)
     {
		var childCount = basicItemLst.item(idx).childNodes.length;
		var jj=0;
		for (jj=0; jj<childCount; jj++)
		{
			var basicAtom = basicItemLst.item(idx).childNodes.item(jj);
			if (basicAtom.nodeType == 3/*TEXT_NODE*/)
				continue;

			/* stroke color */
			if (basicAtom.hasAttribute("clrType"))
			{
				var str = basicAtom.getAttribute("clrType");
				var clrType = parseInt(str);
				var strokeClr = "";
				var strokeAlpha = "1.00";

				if (clrType != 0)
				{
					switch (clrType)
					{
						case 1:
						   strokeClr = grdClr1;  strokeAlpha = vltAlpha1; break; 
						case 2:
						   strokeClr = grdClr2;  strokeAlpha = vltAlpha2; break;
						case 3:
						   strokeClr = grdClr3;  strokeAlpha = vltAlpha3; break;
						case 4:
						   strokeClr = grdClr4;  strokeAlpha = vltAlpha4; break;
						default:
						   break;
					}

					if (strokeClr != "")
					{
						basicAtom.setAttribute("stroke", strokeClr);
						if (strokeAlpha != "1.00")
							basicAtom.setAttribute("stroke-opacity", strokeAlpha);

					}
				}// clrType != 0
			}// basicAtom.hasAttribute("clrType")

			/* fill color */
			if (basicAtom.hasAttribute("bgclrType"))
			{
				var str = basicAtom.getAttribute("bgclrType");
				var bgclrType = parseInt(str);
				var fillClr = "";
				var fillAlpha = "1.00";

				if (bgclrType != 0)
				{
					switch (bgclrType)
					{
						case 1:
						   fillClr = grdClr1; fillAlpha = vltAlpha1; break; 
						case 2:
						   fillClr = grdClr2; fillAlpha = vltAlpha2; break;
						case 3:
						   fillClr = grdClr3; fillAlpha = vltAlpha3; break;
						case 4:
						   fillClr = grdClr4; fillAlpha = vltAlpha4; break;
						default:
						   break;
					}

					if (fillClr != "")
					{
						basicAtom.setAttribute("fill", fillClr);
						if (fillAlpha != "1.00")
							basicAtom.setAttribute("fill-opacity", fillAlpha);

					}
				}// bgclrType != 0
			}// basicAtom.hasAttribute("bgclrType")
		}// for (jj=0; jj<childCount; jj++)

     }// for (idx=0; idx < nLen; idx++)
}

var metaCounter = 0;
function parseCloneNode(clonedElem)
{
	/* modify the powerMeta's Id */
	var srcId = clonedElem.getAttribute("id");
	var desId = metaCounter + "_" + srcId;
	clonedElem.setAttribute("id", desId);

	var scriptElemLst = clonedElem.getElementsByTagName("script");
	var scriptElem;
	if (scriptElemLst.length != 0) // so there are some animation
	{
	    scriptElem = scriptElemLst.item(0);  
		var imgDefLst = clonedElem.getElementsByTagName("image");
		if (imgDefLst.length != 0) // so there are image animation
		{
		    var kk;
			for (kk=0; kk<imgDefLst.length; kk++)
			{
			    var imageElem = imgDefLst.item(kk);
				var oldId = imageElem.getAttribute("id");
				imageElem.setAttribute("id", metaCounter + "_" + oldId);
			}

			var useElement = clonedElem.getElementsByTagName("use").item(0);
			var oldId = useElement.getAttribute("id");
			useElement.setAttribute("id", metaCounter + "_" + oldId);

			// modify link id
			var oldLinkId = useElement.getAttribute("xlink:href");
			oldLinkId = oldLinkId.substring(1, oldLinkId.length);
			useElement.setAttribute("xlink:href", "#" + metaCounter + "_" + oldLinkId);

			// modify script
			var strLst = srcId.split("_");
			var idPre = strLst[0];
			var srcData = scriptElem.firstChild.nodeValue;
			var srcDataList = srcData.split("\n");

			// first Line
			var line1Lst = srcDataList[0].split("=");
			var line1Section1 = line1Lst[0].replace("imgAn_", "imgAn_" + metaCounter + "_");
			var tmpLst = line1Lst[1].split(",");
			var line1Section2 = tmpLst[0].replace(idPre, metaCounter + "_" + idPre);
			var line1Section3 = tmpLst[1].replace(idPre, metaCounter + "_" + idPre);
			var desLine1 = line1Section1 + " = " + line1Section2 + "," + line1Section3 + "," + tmpLst[2] + "," + tmpLst[3];

			// secnod Line
			var desLine2 = srcDataList[1].replace("imgAn_", "imgAn_" + metaCounter + "_");
			var desData = desLine1 + "\n" + desLine2 + "\n";

			scriptElem.firstChild.data = desData;
		}
		else  // there are line animation
		{
		    var pathElemLst = clonedElem.getElementsByTagName("path");
			var jj;
			for (jj=0; jj<pathElemLst.length; jj++)
			{
				var pathElem = pathElemLst.item(jj);
				if (pathElem.hasAttribute("id"))
				{
					var oldId = pathElem.getAttribute("id");
					pathElem.setAttribute("id", metaCounter + "_" + oldId);
				}
			}
			var strLst = srcId.split("_");
			var idPre = strLst[0];

			var srcData = scriptElem.firstChild.nodeValue;
			var srcDataLst = srcData.split("\n");

			var tmpData = srcDataLst[0].replace("lnAn_", "lnAn_" + metaCounter + "_");

			var desLine1 = tmpData.replace(idPre, metaCounter + "_" + idPre);


			var desLine2 = srcDataLst[1].replace("lnAn_", "lnAn_" + metaCounter + "_");
			var desData = desLine1 + "\n" + desLine2 + "\n";;
			scriptElem.firstChild.data = desData;
			//alert(desData);
		}
	}
}

function drawPowerAtom(atomId, metaId, nStatusCount, curStatus, vltClr1, vltClr2, vltClr3, vltClr4, vltAlpha1, vltAlpha2, vltAlpha3, vltAlpha4)
{
     /* the atom element */
     var atom = document.getElementById(atomId);

     /* the transform element of atom */
     var atomTrans = atom.firstChild.nextSibling;

    var i=0
    for (i=0; i<nStatusCount; i++)
    {
		 /* get the powerMeta element */
		 var statusMetaId = metaId + "_" + i;
		 var powerMeta = document.getElementById(statusMetaId);
		 var importPowerMeta = powerMeta.cloneNode(true);

		 /* parse the importPowerMeta to deal with animation */
		 parseCloneNode(importPowerMeta);

		 /* modify the poerMeta to use voltage grade color */
		 useVoltageColor(importPowerMeta, vltClr1, vltClr2, vltClr3, vltClr4, vltAlpha1, vltAlpha2, vltAlpha3, vltAlpha4);

         /* create powerMeta defs element */
		 var metaDefsElem = document.createElement("defs");
		 metaDefsElem.appendChild(importPowerMeta);

		 /* append the defs element to the document */
		 atomTrans.appendChild(metaDefsElem);
    }

	metaCounter++;
}
