function scaleSvg(num)
{
   // 运用VIEWER实现的放大缩小
   var root;
   root=svg.getSVGDocument().documentElement;
   svg.style.width=root.attributes.getNamedItem("width").nodeValue*num;
   svg.style.height=root.attributes.getNamedItem("height").nodeValue*num;
   root.currentScale =  num;
}
*/
var scaleFactor = 1.0;

// 放大
function SEA_ZoomIn()
{
	scaleFactor += 0.2;
	scaleSvg(scaleFactor);
}

//  缩小
function SEA_ZoomOut()
{
	scaleFactor -= 0.2;
	if (scaleFactor <= 0)
	{
		scaleFactor = 0.2;
	}

	scaleSvg(scaleFactor);
}

// 原始大小
function SEA_original_Scale()
{
	scaleFactor = 1.0;
	scaleSvg(scaleFactor);
}

function lineAnimate(animateItemId, animateDir, isLong)
{
	this.animateElemId = animateItemId;
	this.direction = animateDir;
	this.bLong = isLong;
	this.counter = 1;

	this.doAn = function()
	{
		var targt = document.getElementById(this.animateElemId);
		if (this.direction)
		{
			if (this.bLong)
			{
				switch(this.counter)
				{
				case 8:
					targt.setAttribute("stroke-dasharray", "12 9 3 0"); break;
				case 7:
					targt.setAttribute("stroke-dasharray", "9 9 6 0"); break;
				case 6:
					targt.setAttribute("stroke-dasharray", "6 9 9 0"); break;
				case 5:
					targt.setAttribute("stroke-dasharray", "3 9 12 0"); break;
				case 4:
					targt.setAttribute("stroke-dasharray", "0 9 15 0"); break;
				case 3:
					targt.setAttribute("stroke-dasharray", "0 6 15 3"); break;
				case 2:
					targt.setAttribute("stroke-dasharray", "0 3 15 6"); break;
				case 1:
					targt.setAttribute("stroke-dasharray", "15 9"); break;
				}
				if (this.counter == 8) this.counter = 0;
				this.counter++;
			}// if(this.bLong)
			else
			{
				switch(this.counter)
				{
				case 8:
					targt.setAttribute("stroke-dasharray", "6 4.5 1.5 0"); break;
				case 7:
					targt.setAttribute("stroke-dasharray", "4.5 4.5 3 0"); break;
				case 6:
					targt.setAttribute("stroke-dasharray", "3 4.5 4.5 0"); break;
				case 5:
					targt.setAttribute("stroke-dasharray", "1.5 4.5 6 0"); break;
				case 4:
					targt.setAttribute("stroke-dasharray", "0 4.5 7.5 0"); break;
				case 3:
					targt.setAttribute("stroke-dasharray", "0 3 7.5 1.5"); break;
				case 2:
					targt.setAttribute("stroke-dasharray", "0 1.5 7.5 3"); break;
				case 1:
					targt.setAttribute("stroke-dasharray", "7.5 4.5"); break;
				}
				if (this.counter == 8) this.counter = 0;
				this.counter++;
			}
		}// if (this.direction)
		else
		{
		    if (this.bLong)
		    {
				switch(this.counter)
				{
				case 1:
					targt.setAttribute("stroke-dasharray", "12 9 3 0"); break;
				case 2:
					targt.setAttribute("stroke-dasharray", "9 9 6 0"); break;
				case 3:
					targt.setAttribute("stroke-dasharray", "6 9 9 0"); break;
				case 4:
					targt.setAttribute("stroke-dasharray", "3 9 12 0"); break;
				case 5:
					targt.setAttribute("stroke-dasharray", "0 9 15 0"); break;
				case 6:
					targt.setAttribute("stroke-dasharray", "0 6 15 3"); break;
				case 7:
					targt.setAttribute("stroke-dasharray", "0 3 15 6"); break;
				case 8:
					targt.setAttribute("stroke-dasharray", "15 9"); break;
				}
				if (this.counter == 8) this.counter = 0;
				this.counter++;
		    }
			else
			{
				switch(this.counter)
				{
				case 1:
					targt.setAttribute("stroke-dasharray", "6 4.5 1.5 0"); break;
				case 2:
					targt.setAttribute("stroke-dasharray", "4.5 4.5 3 0"); break;
				case 3:
					targt.setAttribute("stroke-dasharray", "3 4.5 4.5 0"); break;
				case 4:
					targt.setAttribute("stroke-dasharray", "1.5 4.5 6 0"); break;
				case 5:
					targt.setAttribute("stroke-dasharray", "0 4.5 7.5 0"); break;
				case 6:
					targt.setAttribute("stroke-dasharray", "0 3 7.5 1.5"); break;
				case 7:
					targt.setAttribute("stroke-dasharray", "0 1.5 7.5 3"); break;
				case 8:
					targt.setAttribute("stroke-dasharray", "7.5 4.5"); break;
				}
				if (this.counter == 8) this.counter = 0;
				this.counter++;
			}
		}// else
	}// end of function()
}

function imageAnimate(useImageId, imageDefId, imageCount, direction)
{
    this.useId = useImageId;
    this.picDefId = imageDefId;
    this.imageNum = imageCount;
    this.anDir = direction;
    if (this.anDir)
        this.counter = 0;
    else
        this.counter = imageCount;

    this.doImageAnimate = function()
    {
        var useTarget = document.getElementById(this.useId);
        if (this.anDir)
        {
            this.counter++;
            if (this.counter == this.imageNum) this.counter = 0;
        }
        else 
        {
            this.counter--;
            if (this.counter == -1) this.counter = this.imageNum - 1;
        }
        var curPicId = "#" + this.picDefId + "_" + this.counter;
        useTarget.setAttribute("xlink:href", curPicId);
    }
}
